import React from 'react';
import './App.css';
import InitialPage from './pages/InitialPage';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <InitialPage />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
